import React, { useState, useEffect } from "react";
import BtnGroup from "../../btnGroup";
import db from "../../db";
import Instructions from "../../instruction";
import Question from "../../Question";


function Home() {
  const [quiz, setQuiz] = useState(null)
  const [sumit, setSubmit] = useState(false)

  useEffect(() => {
    async function fetchQuizes() {
      db.getMCQ()
        .then((quizes) => setQuiz(quizes.data))
        .catch((error) => console.log(error));
    }
    fetchQuizes();
  }, []);



  return (
    <div className="wrapper">
      {quiz && console.log(quiz)}
      <BtnGroup/>
      <div className="contain">
       {/* <Instructions onStart={() => console.log("hello")} />  */}
     {
     !sumit && quiz && typeof(quiz.length) !== 'undefined' && <Question setSubmit={setSubmit} MCQs={quiz} />
     }  

      </div>
    </div>
  );
}

export default Home;
